import React from "react";
import './SVG-Map.css'

const MapTimelineAsia = ({Century}) => {
    return (
        <div>
            {Century === 18 && <h1>Asia 18th century</h1>}
            {Century === 19 && <h1>Asia 19th century</h1>}
            {Century === 20 && <h1>Asia 20th century</h1>}
        </div>
    );
}

export default MapTimelineAsia;
